import logo from "./logo.svg";
import "./App.css";

function App() {
  const paymentCall = () => {
    fetch("http://localhost:4000/payment", {
      headers: {
        "Content-type": "application/json",
      },
      method: "POST",
      body: JSON.stringify({
        name: "Aniket",
        Id: "123456",
        Email: "abns@jhafg",
      }),
    })
      .then((res) => res.text())
      .then((res) => console.log(res.key));
  };
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <button onClick={paymentCall}>Call Payment</button>
      </header>
      <button onClick={paymentCall}>Call Payment</button>
    </div>
  );
}

export default App;
